import Cover from "../../../assets/Autopilot/360.jpg";

const Learn_360 = () => {
  return (
    <section
      className="fullSection"
      style={{ backgroundImage: "url(" + Cover + ")" }}
    ></section>
  );
};

export default Learn_360;
